import React from "react";
import Header from './Header';
const Assistant = () => {
    const handleChange=(e)=>{
        console.log(e.target.value)
    }
    return (
        <div className="ax-w-7xl mx-auto">
            <Header />
            <div className=" pt-16 bg-gray-200">
                <div className="text-center ">
                    <h1 className="text-lg md:text-3xl font-semibold">Улучшение знания начинается здесь с ассистентами СДУ</h1>
                    <p className="text-xl font-normal mt-2  ">Мы вам предлагаем самых профессиональных ассистентов для хорошей успеваемости</p>
                </div>
                <div className="">
                    <p className="bg-white w-96">Course</p>
                    <input type='text'className=" block w-96 h-12  text-gray-700  rounded py-3 px-4 bg-white leading-tight focus:outline-none  focus:border-gray-500" id="grid-last-name" placeholder="Doe"  onChange={handleChange}/>
                    </div>
            </div>
            
        </div>
    );
}


export default Assistant;
